original_question:
فرض کریں کہ $z = 2 + \sqrt{2} - (3 + 3 \sqrt{2})i$، اور $c = 2 - 3i$۔ $w$ وہ نتیجہ ہے جب $z$ کو $c$ کے گرد $\frac{\pi}{4}$ زاویہ کے ساتھ گھمایا جاتا ہے۔

[asy]
unitsize(0.6 cm);

pair C, W, Z;

Z = (2 + sqrt(2), -3 - 3*sqrt(2));
C = (2,-3);
W = rotate(45,C)*(Z);

draw(Z--C--W);

dot("$c$", C, N);
dot("$w$", W, SE);
dot("$z$", Z, S);
label("$\frac{\pi}{4}$", C + (0.6,-1));
[/asy]

$w$ تلاش کریں۔

